    headers: {
      "content-type": "application/x-www-form-urlencoded",
      "x-rapidapi-key": "d257bc4125msh092415e720b73f8p10e3a0jsn9d1dde59496a",
      "x-rapidapi-host": "LastFmdimashirokovV1.p.rapidapi.com",
    },
    data: { apiKey: "3c49d63630980dac550d6ffd238fa4a3" },
  };
  axios
    .request(options)
    .then(function (response) {
      console.log(response.data);
    })
    .catch(function (error) {
      console.error(error);
    });

}

export default App;
